import React, { useState } from "react";
import { Route, Routes, BrowserRouter } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";

import Allprojects from "./components/AllProjects.jsx";
import Addproject from "./components/Add.jsx";
import Updateproject from "./components/UpdateProject.jsx";
import SignUp from "./components/SingUp";
import Login from "./components/Login";
import OneProject from "./components/OneProject.jsx";
import Myprojects from "./components/Myprojects";
import Profile from "./components/Profil";
import UpdateProfile from "./components/UpdateProfile";
import  Navbar  from "./components/content/Navbar.jsx";

function App() {
  const [userData, setUserData] = useState({});

  const userIn = (obj) => {
    setUserData(obj);
  };

  return (
    <div className="App wrapper">
      <Navbar
      bg="light"
      className="navbar shadow-sm p-3 mb-5 bg-white rounded"
      expand
    >
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <input
          type="text"
          onChange={(e) => {
            const newTerm = e.target.value;
            setSearchTerm(newTerm);
            searchproject(newTerm);
          }}
        />
        <button
          onClick={() => {
            searchproject(searchTerm);
          }}
        >
          search
        </button>
        <Link to={'/profile'}>
        <Nav className="ml-auto" navbar>
          <Nav.Link
          >
            Profile
          </Nav.Link>
        </Nav>
        </Link>

      </Navbar.Collapse>
    </Navbar>
      <BrowserRouter>
        <Routes>
            <Route path="/" element={<Login userIn={userIn} />} />
            <Route path="/signup" element={<SignUp />} />
            <Route path="/allprojects" element={<Allprojects />} />
            <Route path="/allproject/oneproject" element={<OneProject />} />
            <Route
              path="/myprojects"
              element={<Myprojects userData={userData} />}
            />
            <Route path="/myprojects/addproject" element={<Addproject />} />
            <Route
              path="/myprojects/updateproject"
              element={<Updateproject />}
            />
            <Route path="/profile" element={<Profile userData={userData} />} />
            <Route path="/profile/updateprofile" element={<UpdateProfile />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
